def word_occurence(sentence):
    """
    1. Split the sentence by space to get a list of words.
    2. Traverse over the list of words.
    3. For each word, if it is not in the dictionary, set its occurence as 1. If it is in the dictionary, increment its count by 1.
    4. return the dictionary.
    """
    # Split the sentence by space to get a list of words
    words = sentence.split()
    # Create an empty dictionary
    word_counts = {}
    # Traverse over the list of words
    for word in words:
        # if word is not in word_counts, set its count as 1
        if word not in word_counts:
            word_counts[word] = 1
        else:
            # if word is already in word_counts, increment its count by 1
            word_counts[word] += 1
    # return the dictionary
    return word_counts

